import React from "react";
import {
  Input,
  Flex,
  Heading,
  Container,
  Columns,
  Textarea,
  Stack,
  Button,
  ActionButtons,
} from "bumbag";
import emailjs from "emailjs-com";

import { Users } from "react-feather";
import ButtonUI from "./ButtonUI";
import { Formik, Form, Field } from "formik";

const Contact = () => {
  const emailInfo = {

  }
  const sendEmail = (values) => {
    // e.preventDefault();
    // console.log(values);
    emailjs
      .sendForm(
        "service_eq4k8nu",
        "template_d7xhn8q",
        values,
        "user_PXcI30CjdFLTla1cHZFoV"
      )
      .then(
        (result) => {
          console.log(result.text);
        },
        (error) => {
          console.log(error.text);
        }
      );
  };

  return (
    <Container padding="2rem 1rem">
      <Flex
        display={{ default: "flex", "max-tablet": "block" }}
        alignX="center"
        alignY="center"
        alignItems="baseline"
      >
        <Columns.Column spread={6}>
          <Heading
            use="h4"
            fontWeight={{ default: "semibold", "max-tablet": "bold" }}
            paddingBottom={{ default: "0rem", "max-tablet": "2rem" }}
          >
            Contact
          </Heading>
        </Columns.Column>
        <Columns.Column spread={6}>
          <Formik
            initialValues={{ name: "", email: "", message: "" }}
            onSubmit={(values) => sendEmail(values)}
          >
            <Form>
              {/* <Stack spacing="major-6"> */}
              <Field
                component={Input.Formik}
                variant="underline"
                name="name"
                type="text"
                label="Name"
              />
              <Field
                component={Input.Formik}
                variant="underline"
                name="email"
                type="email"
                label="Email"
              />
              <Field
                component={Textarea.Formik}
                variant="underline"
                name="message"
                type="text"
                placeholder="Message"
                // spellCheck={true}
                style={{
                  border: "0",
                  borderBottom: "1px solid var(--bb-palette-white900, #000000)",
                  borderRadius: "0",
                  background: "none",
                  padding: "0",
                }}
              />
              {/* <ButtonUI
              name={"Send"}
              value="Send"
              isSend
              onClick={(e) => console.log("clicked")}
            /> */}
              <Button
                value="Send"
                type="submit"
                // onClickSubmit={sendEmail}
              >
                Submit
              </Button>
              {/* </Stack> */}
            </Form>
          </Formik>
        </Columns.Column>
      </Flex>
    </Container>
  );
};

export default Contact;
